import React from 'react';
import Navbar from './components/Navbar';
import './App.css';
import Homepage from './components/pages/Homepage';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import PagePanier from './components/pages/PagePanier';
import PageFicheProduit from './components/pages/PageFicheProduit';
import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';
import BoutiqueSection from './components/pages/BoutiqueSection';
import Productcarousel from './Productcarousel';
import Footer from './components/footer';
import { Panier } from './components/Button';


function App() {


  return (
    <Router>
      <Navbar />
      <Switch>
        <Route path='/' exact component={Homepage} />
        <Route path='/services' component={BoutiqueSection} />
        <Route path='/products' component={PagePanier} />
        <Route path='/marketing' component={PageFicheProduit} />
      </Switch>
      <Productcarousel />
      <Footer />
      </Router>
  );
}

export default App;
